import React from 'react';

const NoCounters = () => {
	return <h1 className="text-center">You don't have any counters yet</h1>;
};

const NoMatchingItems = ({ onGoBack }) => {
	return (
		<div className="error">
			<h3>None of the counters match the specified conditions :(</h3>
			<p className="link" onClick={onGoBack}>
				Go back
			</p>
		</div>
	);
};

export { NoCounters, NoMatchingItems };
